import styled from 'styled-components';

const Wrapper = styled.div`
  .vote-grid-title-grid {
    margin: 30px;
  }
  .vote-grid-title-typography1 {
    font-weight: 900;
    font-size: 70px;
  }
  .vote-grid-title-typography2 {
    max-width: 1000px;
    margin: 15px auto 60px;
    word-break: keep-all;
    font-size: 24px;
    line-height: 1.25;
    font-weight: 500;
  }
`;

export default Wrapper;
